pragma solidity ^0.4.24;

contract MeshBounty {

    address owner;
    enum ServiceBountyStatus {ACTIVE, CLAIMED, CANCELLED, ENDED}
    ServiceBountyStatus bountyStatus;

    mapping(uint=>address) registeredNodes;
    uint registeredNodesCount;//keep an index

    // struct Contribution {
    //     address contributor;
    //     uint amount;
    // }

    // struct Bounty {
    //     address creator;
    //     mapping(address=>uint) contributors;
    //     uint blockEnd;
    //     uint bountyBlockStart;
    //     uint bountyServiceStartBlock;
    //     uint bountyServiceEndBlock;
    // }

    //mapping(uint=>Bounty) serviceBounties;


    //EVENTS
    constructor() public {
        owner = msg.sender;
    }


     function getOwner() public view returns(address) { 
        return owner;
    }

    event ServiceProviderAdded(address indexed _addr);

    function registerServiceProvider(address _addr) external returns(address){
        registeredNodes[registeredNodesCount] = _addr;
        registeredNodesCount++;
        emit ServiceProviderAdded(_addr);
        return _addr;
    }

    function getRegisteredProviders() view returns(address[]){
        //TODO: testing only. Never iterate through uknown length array;.. dont use storage

        address[] memory tempAddresses;
        for(uint8 i=0; i<registeredNodesCount; i++){
            tempAddresses[i] = registeredNodes[i];
        }
        return tempAddresses;

    }



}
